import React from "react";
const  Compo=()=>{
    return (
    <>
    <select className="Opt">
        <option value="1">1</option>
        <option value="25">25</option>
        <option value="3">3</option>
        <option value="5">5</option>
        <option value="6">6</option>
    </select>
    </>
    )
}
export default Compo;
